import React from 'react';

class ImageList extends React.Component {
    render() {
        let { countryList, onClickCountry } = this.props;

        let countries = null;
        if (!!countryList) {
            countries = countryList.map((country) => (
                <li onClick={() => onClickCountry(country)}>{country}</li>
            ));
        }
        return (
            <div>
                <h3>
                    COUNTRY
                </h3>
                <ul>
                    {countries}
                </ul>
            </div>
        );
    }
}

export { ImageList }
